import { TextField } from "@mui/material";
import React from "react";
import useForm from "../hooks/useForm";

export default function FormLogin() {
  const [form, onChange, clear] = useForm({email:'', password: ''})

  const submitForm = (e) => {
    e.preventDefault()
  }

  return (
    <div>
      <form onSubmit={submitForm}>
        <TextField required type={'email'} value={form.email} onChange={onChange} placeholder="Digite seu email"></TextField>
        <TextField required type={'password'} value={form.password} onChange={onChange} placeholder="Digite sua senha"></TextField>
      </form>
      <button>Fazer Login</button>
    </div>
  );
}
